import React from 'react'
import { Container, Nav, Navbar } from 'react-bootstrap';


function NavigationBar() {
    const arr = [
    {
      id: 1,
      name: 'HOME',
      count: 0
    },
    {
      id: 2,
      name: 'ABOUT US',
      count: 0
    },
    {
      id: 3,
      name: 'CONTACT US',
      count: 0
    },
    {
      id: 4,
      name: 'PRICING',
      count: 0
    }
  ]

  return (
    <>
      <Navbar bg='dark' variant='dark'>
        <Container>
          <Nav>
            {
              arr.map(
                (item, index)=> <Nav.Link>{item.name}</Nav.Link>)
            }
          </Nav>
        </Container>
      </Navbar>
    </>
  )
}

export default NavigationBar
